CREATE DEFINER=`root`@`localhost` PROCEDURE `BuscarProducto`(
    IN p_palabraClave VARCHAR(100)
)
BEGIN
    SELECT * FROM Producto
    WHERE (nombreProducto LIKE CONCAT('%', p_palabraClave, '%') OR p_palabraClave IS NULL)
    AND isActive = TRUE;
END ;;
